import React from 'react';

const Header = () => {
  return (
    <div className="hero-section h-screen flex items-center justify-center text-white">
  <div className="container mx-auto px-6 flex justify-between items-center">
    <div className="hero-text">
      <h1 className="text-5xl font-bold mb-6 text-shadow">
        Compassionate Legal Counsel for Difficult Times
      </h1>
      <p className="text-xl mb-8 text-shadow">
        Get the support you need during life's toughest challenges with law.
      </p>
      <a href="#" className="btn-contact">
        Contact Us Today
      </a>
    </div>
  </div>
</div>

  );
};

export default Header;
